import React, { useState, useEffect } from "react";

export default function TriGasDashboard() {
  const [o2, setO2] = useState(5.7);
  const [co2, setCO2] = useState(5.4);
  const [targetO2, setTargetO2] = useState(5.5);
  const [targetCO2, setTargetCO2] = useState(5.5);
  const [alarmO2, setAlarmO2] = useState(false);
  const [alarmCO2, setAlarmCO2] = useState(false);
  const [flash, setFlash] = useState(false);

  useEffect(() => {
    const flashInterval = setInterval(() => {
      setFlash((f) => !f);
    }, 1000); // 1 second flash
    return () => clearInterval(flashInterval);
  }, []);

  useEffect(() => {
    setAlarmO2(Math.abs(o2 - targetO2) > 0.5);
    setAlarmCO2(Math.abs(co2 - targetCO2) > 0.5);
  }, [o2, co2, targetO2, targetCO2]);

  const gasCardStyle = (gas, alarm) => {
    if (!alarm) return gas === "O2" ? "bg-green-100" : "bg-blue-100";
    return flash ? (gas === "O2" ? "bg-red-300" : "bg-pink-300") : (gas === "O2" ? "bg-green-100" : "bg-blue-100");
  };

  return (
    <div className="w-screen h-screen grid grid-cols-2 gap-4 p-4 bg-gray-100">
      
      {/* CO2 Panel */}
      <div className={`${gasCardStyle("CO2", alarmCO2)} rounded-xl flex flex-col justify-center items-center shadow-lg p-6 relative`}>
        <h2 className="text-xl font-bold">% Carbon Dioxide</h2>
        <p className="text-6xl font-bold mt-2">{co2.toFixed(1)}</p>
        <p className="mt-2 text-sm">Target: {targetCO2.toFixed(1)}</p>
        <input
          type="range"
          min="0"
          max="10"
          step="0.1"
          value={targetCO2}
          onChange={(e) => setTargetCO2(parseFloat(e.target.value))}
          className="w-2/3 mt-4"
        />
      </div>

      {/* O2 Panel */}
      <div className={`${gasCardStyle("O2", alarmO2)} rounded-xl flex flex-col justify-center items-center shadow-lg p-6 relative`}>
        <h2 className="text-xl font-bold">% Oxygen</h2>
        <p className="text-6xl font-bold mt-2">{o2.toFixed(1)}</p>
        <p className="mt-2 text-sm">Target: {targetO2.toFixed(1)}</p>
        <input
          type="range"
          min="0"
          max="10"
          step="0.1"
          value={targetO2}
          onChange={(e) => setTargetO2(parseFloat(e.target.value))}
          className="w-2/3 mt-4"
        />

        {/* Menu */}
        <div className="absolute top-4 right-4">
          <Menu />
        </div>
      </div>
    </div>
  );
}

function Menu() {
  const [open, setOpen] = useState(false);
  return (
    <div className="relative">
      <button onClick={() => setOpen((o) => !o)} className="w-6 h-6 flex flex-col justify-between items-center">
        <span className="w-full h-1 bg-black" />
        <span className="w-full h-1 bg-black" />
        <span className="w-full h-1 bg-black" />
      </button>
      {open && (
        <div className="absolute right-0 top-8 bg-white border shadow-lg p-2 text-sm rounded space-y-1 z-50 w-40">
          <button className="hover:bg-gray-100 w-full text-left px-2 py-1">Control Deadband</button>
          <button className="hover:bg-gray-100 w-full text-left px-2 py-1">Alarm Limits</button>
          <button className="hover:bg-gray-100 w-full text-left px-2 py-1">Data File Menu</button>
          <button className="hover:bg-gray-100 w-full text-left px-2 py-1">Password Settings</button>
        </div>
      )}
    </div>
  );
}
